import React from "react";
import { Redirect } from "react-router-dom";

import Navigation from "./Navigation";
import { storage, validateEmail, validateName } from "./Formfilled";

const Listout = () => {
    if (!validateEmail(storage.email) || !validateName(storage.name)) {
        return <Redirect to="/Formfilled" />;
    }

    return (
        <div>
            <Navigation current={2} prevDisabled={false} />
            <h2>Congratulations</h2>
            <p>You have completed the form.</p>
        </div>
    );
};

export default Listout;
